import React from "react";
import "./style.scss";
import Slider from "../../components/Slider";
import Checkbox from "../../components/Checkbox";

import { Container, Row, Col } from "react-bootstrap";
function Main() {
  return (
      <Container className="fondo">
          <Row>
            <Col className="a1">
              <Checkbox />
            </Col>
            <Col className="a2">1</Col>
            <Col className="a3">1</Col>
            <Col className="a4">1</Col>
          </Row>
          <Row>
            <Col>1</Col>
            <Col>
              <Slider />
            </Col>
            <Col>1</Col>
            <Col>1</Col>
          </Row>
      </Container>
  );
}

export default Main;
